import React from 'react';


  export default function List(props) {
    //    console.log(props.list);
       let lista = props.list;
    console.log(lista);
    return (
        <div>
          <h2>List</h2>
          {lista.map((item, index) => (
        <div>key={index} item={item} </div>
      ))}
        </div>
    );
}
